import { NavLink } from 'react-router-dom';

const Footer = () => {
  return (
    <footer className="footer">
      <p className="footer__copyrights">Â© {new Date().getFullYear()} Daniel Malka, protfolio page</p>
      <nav className="footer__wrap">
        <ul className="footer__div">
          <li className="footer__link footer__button"></li>
          <li className="footer__email footer__button">Home</li>
        </ul>
        <ul className="footer__imgs">
          <li>
            <a target="_blank" href="https://github.com/daniel-malka" className="footer__git footer__button" rel="noreferrer"></a>
          </li>
          <li>
            {' '}
            <a
              target="_blank"
              href="https://www.linkedin.com/in/danmalk/"
              className="footer__git footer__button"
              rel="noreferrer"
            ></a>
          </li>
        </ul>
      </nav>
    </footer>
  );
};

export default Footer;
